-- 导出  表 dev_crm_02.customers_basic 结构
CREATE TABLE IF NOT EXISTS `customers_basic` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建员工 id',
  `salesman_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '服务员工 id 被索取之后 变为对应的员工',
  `name` varchar(20) NOT NULL COMMENT '客户姓名',
  `type` char(3) NOT NULL COMMENT '客户类型 请查看文档 首字母',
  `phone_del` char(11) DEFAULT NULL COMMENT '手机号',
  `phone2_del` char(11) NOT NULL COMMENT '座机号',
  `qq_del` varchar(15) DEFAULT NULL COMMENT 'QQ',
  `qq2_del` varchar(15) NOT NULL DEFAULT '0' COMMENT 'QQ2',
  `qq_nickname_del` varchar(20) NOT NULL DEFAULT '' COMMENT 'QQ昵称',
  `qq_nickname2_del` varchar(20) NOT NULL DEFAULT '' COMMENT 'QQ昵称2',
  `weixin_del` varchar(20) DEFAULT NULL COMMENT '微信号',
  `weixin_nickname_del` varchar(20) NOT NULL DEFAULT '0' COMMENT '微信昵称',
  `sex` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '0 未定义 1 男 2 女',
  `area_province` int(10) unsigned DEFAULT '0' COMMENT '省份id',
  `province_name` varchar(30) NOT NULL DEFAULT '' COMMENT '省份名',
  `area_city` int(10) unsigned DEFAULT '0' COMMENT '城市id',
  `city_name` varchar(30) NOT NULL DEFAULT '' COMMENT '城市名',
  `quality` tinyint(4) NOT NULL COMMENT '客户质量 看文档',
  `re_income` tinyint(4) NOT NULL COMMENT '近期收益',
  `year` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '股龄',
  `style` tinyint(4) NOT NULL COMMENT '投资风格',
  `money` tinyint(4) NOT NULL COMMENT '资金量',
  `energy` tinyint(4) NOT NULL COMMENT '看盘精力',
  `problem` tinyint(4) NOT NULL COMMENT '投资问题',
  `mode` tinyint(4) NOT NULL COMMENT '盈利模式',
  `attitude` tinyint(4) NOT NULL COMMENT '客户态度',
  `profession` tinyint(4) NOT NULL COMMENT '客户职业',
  `intention` tinyint(4) NOT NULL COMMENT '客户软件意向',
  `source` tinyint(4) NOT NULL COMMENT '客户来源',
  `remark` varchar(255) NOT NULL DEFAULT '0' COMMENT '备注',
  `plan` timestamp NULL DEFAULT NULL COMMENT '下次计划跟踪时间',
  `log_count` tinyint(4) NOT NULL DEFAULT '0' COMMENT '日志纪录总数',
  `transfer_status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '转让状态 0 未转让 1转让中  2 转让完',
  `transfer_to` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '转让给 user_id',
  `important` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否自选 1 是 0 不是',
  `conflict` timestamp NULL DEFAULT NULL COMMENT '最后一次冲突时间',
  `last_track` datetime NOT NULL COMMENT '跟踪方最后跟踪时间',
  `lock_track` datetime NOT NULL COMMENT '锁定方最后跟踪时间',
  `ser_track` datetime NOT NULL COMMENT '服务方对话跟踪时间',
  `commission` tinyint(4) NOT NULL DEFAULT '100' COMMENT '跟踪方比例',
  `remind` varchar(255) NOT NULL COMMENT '提醒',
  `id_card` char(20) NOT NULL DEFAULT '' COMMENT '身份证',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '客户创建时间',
  `service_time` int(11) NOT NULL COMMENT '服务时间 用于确定 "6个月未成交" 的判断',
  `help_salesman` varchar(50) DEFAULT NULL COMMENT '导入数据辅助列 业务员',
  `help_transfer` varchar(50) NOT NULL COMMENT '导入数据辅助列 管理人',
  `help_user` varchar(50) DEFAULT NULL COMMENT '导入数据辅助列 创建人',
  `help_group_id` int(11) DEFAULT NULL COMMENT '导入数据辅助列 小组对应的id',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1 显示 0保留待用 -1隐藏',
  PRIMARY KEY (`id`),
  UNIQUE KEY `Index 2` (`phone_del`),
  UNIQUE KEY `Index 3` (`qq_del`),
  UNIQUE KEY `Index 4` (`weixin_del`)
) ENGINE=InnoDB AUTO_INCREMENT=5361 DEFAULT CHARSET=utf8 COMMENT='客户表 ';

